★自宅で簡単フィットネス！M-netのアンクル・リストバンド！<br>
<br>
●マジックテープで簡単装着！手、足の筋力アップに効果的！<br>
●運動時の着用でより効果が期待できます。<br>
●運動時に限らず使えるため、通勤時や家事をしながらなど、日常生活でも効果が期待できます！<br>
●重量1.5kg(1個あたり)の2個セットです。<br>
<br>
■素材 ポリエステル・SBR・スチール<br>
■企画製造販売元：ライテック株式会社<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。
<BR>
<BR>
■適応サイズ(手首・足首周り):約41cmまで<br>
