■メンズ レディース SINANOのウォーキングポール！
<BR>
<BR>
★ワンタッチで楽々長さ調節、ファストロック採用のウォーキングポール！<br>
<br>
●レバーを操作するだけ。ワンタッチで簡単にシャフトの長さを調節できます！<br> 
●ファスト・ロック機能採用！レバー操作は、女性も力を入れず簡単にできます。<br>
●女性の方も握りやすい細身のスモールグリップ使用。<br>
<br> 
■重量：約230ｇ／１本<br>
■素材：シャフト上・下段ともアルミ製<br>
■企画製造販売元：株式会社シナノ<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。
