★アスファルトの衝撃を分散し快適なシティウォーキングを！シダスのインソール！<br>
<br>
●用途別に最適な特殊素材を採用し、その組み合わせや形状が専用設計されたフラッシュフィットシリーズのインソール。<br>
●シティプラスのハーフサイズ。隙間の少ないタウンシューズ用となります！<br>
●吸湿性があり、足当たりのよいAMF素材を表面に採用！<br>
●【AMF】吸湿性に優れたマイクロファイバー素材。<br>
<br>
※商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。
<BR>
<BR>
■サイズ<br>
XS(22.0～23.0cm)、S(23.5～24.5cm)、M(25.0～26.5cm)、L(27.0～28.0cm)、XL(28.5～29.5cm)<br>
