★重さに秘密あり！歩行に適度な加重をプラスし、より効率のよい脂肪燃焼を実！<br>
・ソールに金属粒を入れることで、歩行に適度な加重をプラス。<br>
・一体成形により、柔軟性と重さを両立させた画期的なトレーニングシューズ！<br>
<br>
★３０分のウォーキングで最大約３００Ｋｃａｌを消費！<br>
・通常の靴よりもエネルギー代謝率が２５％ＵＰ！<br>
・ウォーキング、通勤、散歩、ショッピングなど、場所を選ばずいつでもどこでもシェイプアップする事が出来ます。<br>
<br>
■素材　甲皮：アクションレザー、合成皮革、底材：合成底<br>
■重さ　男性用 1.4kg（片足）、女性用 1.2kg（片足）<br>
■企画製造販売元　株式会社ビーウェル<br>
<br>
■サイズ<br>
メンズ：24.5cm～28.0cm<br>
レディース：22.5cm～25.0cm
<!--受発注注釈-->
<br>
