・一体成形により、柔軟性と重さを両立させた画期的なトレーニングシューズ！<br>
<br>
●３０分のウォーキングで最大約３００Ｋｃａｌを消費！<br>
・通常の靴よりもエネルギー代謝率が２５％ＵＰ！<br>
・ウォーキング、通勤、散歩、ショッピングなど、場所を選ばずいつでもどこでもシェイプアップする事が出来ます。<br>
<br>
■素材　甲皮：牛皮<br>　
■底材：合成底<br>
■カラー：ブラック<br>
■重さ　1.2kg（片足）<br>
■企画製造販売元　株式会社ビーウェル<br>
<br>
【岸田一郎氏 プロフィール】<br>
 1951年4月15日生まれ。大阪府出身。<br>
「Begin」「MensEX」「LEON」「NIKITA」など数々の雑誌の創刊編集長として<br>
さまざまなブームを巻き起こしてきた仕掛け人。<br>
"ちょいモテオヤジ"は2005 年流行語大賞を受賞。<br>
現在はWebメディア「LUXURY TV」製作総指揮の傍ら、講演会や<br>
コンサルティング活動などで活躍中。<br>
